sys_variable_value.value:
(function execute(inputs, outputs) {
  // dot walk from the given package to get values
  var package = inputs.package;
  outputs.name = package.project_overview.title.toString();
  outputs.number = package.number.toString();
  var base = package.period_of_performance.base_period.period_unit_count.toString();
  var unit = package.period_of_performance.base_period.period_unit.toString();
  var basePeriod = base + ' ' + unit;
  outputs.base_period =  basePeriod


  // build JSON string for output
  try {
    var jsonBuilder = new sn_ih.JSONStreamingBuilder().build();
  	jsonBuilder.startObject()
      .enablePrettyPrint()
      .writeFieldName("Name")
      .writeString(package.project_overview.title.toString())
      .writeFieldName("Number")
      .writeString(package.number)
      .writeFieldName("Base Period")
      .writeString(basePeriod)
      .endObject();
  	outputs.payload = jsonBuilder.getJSONString();
  } catch (error) {
    gs.error("An error: " + error);
  } finally {
    jsonBuilder.close()
  }

})(inputs, outputs);

